import { UsersAction, UsersState, } from "../../types/allUsersTypes";


export const usersState = [];
export const UsersReducer=(state = usersState, action: UsersAction): UsersState => {
    switch (action.type) {
        case "GET_ALL_USERS":
            return [
                 ...action.allUsers
            ];
        case "SORT_ALL_USER": {
            return [
                ...action.sortedUser
            ]
        }
        default:
            return state
        }   
}
